import { Icon, Menu } from "antd";
import Link from "next/link";
const links = () => (
	<>
		<Link href="/">
			<a>
				<Icon type="home" />
			</a>
		</Link>
		<Link href="/about-me">
			<Icon type="user" />
		</Link>
	</>
);

export default links;
